import { Button, Container, Typography } from "@mui/material";
import { Box } from "@mui/system";
import { useEffect, useState } from "react";
import { useNavigate } from "react-router";
import NavBar from "../../myComponents/navbar/Navbar";

export default function HomePage() {
  const navigate = useNavigate();
  const [data, setData] = useState([]);

  useEffect(() => {
    var data = JSON.parse(localStorage.getItem('data'));
    setData(data);
  }, [])

  return (
    <Container>
      <NavBar />
      <Box sx={{display: "flex", justifyContent: "space-between", textAlign: "center", backgroundColor: "gray", padding: "20px"}}>
        <Box>
          <Typography variant='small'>Number Of Crypto Coins Types</Typography> <br />
          <Typography variant='small'>{data.length}</Typography>
        </Box>
        <Box>
          <Typography variant='small'>Number Of Crypto Coins</Typography> <br />
          <Typography variant='small'>{data.reduce(function (sum, current) {
            return sum + current.value;
          }, 0)
          }</Typography> <br />

        </Box>
      </Box>
      {
        data?.map((item) => (
         <Box sx={{backgroundColor: "red", padding: "20px"}}>
         <Box sx={{display: "flex", justifyContent: "space-between"}}>
         <h4>{item.name} : {item.value}</h4>
         <Box>
         <Button sx={{ml: "10px"}} variant="contained">Remove</Button>
         <Button variant="contained">Remove</Button>
         </Box>
         </Box>
         </Box>
        ))
      }
    </Container>
  )
}
